import React, { useState } from "react";
import constants from "./constants.js";
const Icon = ({ title, createPanel }) => {
  const [isPanel, setIsPanel] = useState(() => constants[title]["ispanel"]); //display panel or link to html an anonymous function just because
  console.log(title, isPanel);
  return (
    <div onClick={(event) => createPanel(title)} className="icon">
      <a className="icon-anchor" href="/#">
        <img
          className="icon-img"
          src={require("./assets/image.png")}
          alt="123"
        />
        <span className="icon-name">{title}</span>
      </a>
    </div>
  );
};

export default Icon;
